lockfileVersion: '9.0'

settings:
  autoInstallPeers: true
  excludeLinksFromLockfile: false

importers:

  .:
    dependencies:
      unordered-exports-inputs:
        specifier: file:.
        version: 'file:'

packages:

  'unordered-exports-inputs@file:':
    resolution: {directory: '', type: directory}

snapshots:

  'unordered-exports-inputs@file:': {}
